import * as React from 'react';
import {
    AppBar,
    Toolbar,
    Typography,
    Button,
    IconButton,
    MenuIcon
} from '@mui/material';
import Box from '@mui/material/Box';


const Header = () => {
    return(
        <AppBar position="static">
            <Toolbar>
                <IconButton
                    size="large"
                    edge="start"
                    color="inherit"
                    aria-label="menu"
                    sx={{ mr: 2 }}
                >
                <MenuIcon />
                </IconButton>
                <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                News
                </Typography>
                <Button color="inherit">Login</Button>
            </Toolbar>
        </AppBar>
    )
}

export default Header
